import styled from "styled-components/native";

export const ButtonPatient = styled.TouchableOpacity`
  width: 220px;
  height: 44px;
  margin-top: 7px;
  border-radius: 50px;
  background: #4C7ABB;
  border: none;
  justify-content: center;
  align-items: center;
  text-align: center;

  &:hover {
    background: #b4b4b4;
  }
`;
